import React from 'react';
import PopupWithForm from '../PopupWithForm/PopupWithForm';

function RegisterPopup(props) {
  return (
    <PopupWithForm
      title='Sign up'
      isOpen={props.isOpen}
      onClose={props.onClose}
    >
      <p className="popup__field-description">Email</p>
      <input className='popup__field' type="text" placeholder='Enter email' />
      <div className="popup__error-container">
        <span className="popup__field-error avaLink-field-error">errors.avatarLink</span>
      </div>
      <p className="popup__field-description">Password</p>
      <input className='popup__field' type="text" placeholder='Enter password' />
      <div className="popup__error-container">
        <span className="popup__field-error avaLink-field-error">errors.avatarLink</span>
      </div>
      <p className="popup__field-description">Username</p>
      <input className='popup__field' type="text" placeholder='Enter your username' />
      <div className="popup__error-container">
        <span className="popup__field-error avaLink-field-error">errors.avatarLink</span>
      </div>
    </PopupWithForm>
  )
}

export default RegisterPopup;
